export function pageScrollTo({ scrollTop, selector, duration, success, fail, complete }: PageScrollToParam): Promise<any>;
/**
 * pageScrollTo参数
 */
export type PageScrollToParam = {
    /**
     * 滚动到页面的目标位置，单位 px
     */
    scrollTop: number;
    /**
     * 滚动动画的时长，单位 ms
     */
    duration?: number;
    /**
     * 接口调用成功的回调函数
     */
    success?: Function;
    /**
     * 接口调用失败的回调函数
     */
    fail?: Function;
    /**
     * 接口调用结束的回调函数（调用成功、失败都会执行）
     */
    complete?: Function;
};
